14\nToday, my team received a call from the Democratic National Committee letting us know that they will not host a #ClimateDebate. Further, they explained that if we participated in anyone else's climate debate, we will not be invited to future debates. This is deeply disappointing.\n\u2014\nThe DNC is silencing the voices of Democratic activists, many of our progressive partner organizations, and nearly half of the Democratic presidential field, who want to debate the existential crisis of our time. Democratic voters say that climate change is their top issue; the Democratic National Committee must listen to the grassroots of the party.\n\u2014\nWe are running out of time. We've kicked the can down the road for too long. The climate crisis merits a full discussion of our plans, not a short exchange of talking points. The next President must make defeating this crisis the top priority of the nation. And I will continue to do everything I humanly can to ensure the climate crisis is at the top of the national agenda."}}]},"shortcode":"ByV_q4vgIrC","edge_media_to_comment":{"count":159},"comments_disabled":false,"taken_at_timestamp":1559771182,"dimensions":{"height":1080,"width":1080},"display_url":"https://scontent-lga3-1.cdninstagram.com/vp/5165fafa72501f9dccfe1b3dcb59be37/5D967636/t51.2885-15/e35/s1080x1080/61826276_913420145685518_3263649203451051307_n.jpg?_nc_ht=scontent-lga3-1.cdninstagram.com","edge_liked_by":{"count":1182},"edge_media_preview_like":{"count":1182},"location":null,"gating_info":null,"media_preview":null,"owner":{"id":"10361579608","username":"jayinslee"},"thumbnail_src":"https://scontent-lga3-1.cdninstagram.com/vp/be68babc00c9e8b4d26872f04bb0eb4b/5D7F9C81/t51.2885-15/sh0.08/e35/s640x640/61826276_913420145685518_3263649203451051307_n.jpg?_nc_ht=scontent-lga3-1.cdninstagram.com","thumbnail_resources":[{"src":"https://scontent-lga3-1.cdninstagram.com/vp/922c8f92cc08c987395857c84f24353e/5D81A626/t51.2885-15/e35/s150x150/61826276_913420145685518_32636
